requirement.content:
Соответствие требованиям, установленным в соответствии с законодательством Российской Федерации к лицам, осуществляющим поставку товара, выполнение работ, оказание услуг, являющихся объектом закупки:



1) Наличие действующей лицензии на осуществление деятельности по сохранению объектов культурного наследия (памятников истории и культуры) народов Российской Федерации в соответствии Федеральным законом от 04.05.2011
№ 99-ФЗ «О лицензировании отдельных видов деятельности» и Постановлением Правительства РФ от 19.04.2012 г. № 349 «О лицензировании деятельности по сохранению объектов культурного наследия (памятников истории и культуры) народов Российской Федерации.





2) Участник закупки должен быть членом саморегулируемой организации (далее – СРО) в области архитектурно-строительного проектирования , при этом СРО, в которой состоит участник закупки, должна иметь компенсационный фонд обеспечения договорных обязательств;

- участник должен иметь право осуществлять подготовку проектной документации по договору подряда на подготовку проектной документации, заключаемому с использованием конкурентных способов заключения договоров в отношении объектов капитального строительства (кроме особо опасных, технически сложных и уникальных объектов, объектов использования атомной энергии);

- совокупный размер обязательств участника закупки по договорам, заключаемым с использованием конкурентных способов, не должен превышать уровень ответственности участника по компенсационному фонду обеспечения договорных обязательств;

- уровень ответственности участника закупки члена саморегулируемой организации по обязательствам по договору подряда на подготовку проектной документации, и стоимости работ по одному договору, в соответствии с которым указанным членом внесен взнос в компенсационный фонд возмещения вреда должен быть не менее цены контракта предложенной участником на аукционе.
